import React from "react";
import { GoogleLogin } from '@react-oauth/google';
import styled from "styled-components";

const LoginGoogle = () => {
  const responseGoogle = (response) => {
    console.log(response);
    // 여기에서 로그인 후의 로직을 처리할 수 있습니다.
  };


    return (
        <Wrapper>
          <GoogleOAuthProvider clientId={220264219835-hcnl67mi1jacfhksj94v985p2bvidam6.apps.googleusercontent.com}>
                <GoogleLogin
                    onSuccess={(res) => {
                        console.log(res);
                    }}
                    onFailure={(err) => {
                        console.log(err);
                    }}
                />
            </GoogleOAuthProvider>

        </Wrapper>
    );
};

export default LoginGoogle;

const Wrapper = styled.div`
padding-left: 170px;
padding-right: 170px;
.title{
  color: #212529;
  font-size: 32px;
  font-family: Pretendard Variable;
  font-weight: 700;
  line-height: 46px;
  word-wrap: break-word;
}
`
